import React from 'react';
import { Link } from 'gatsby';
import styled from 'styled-components';


const HeaderMenuStyle = styled.header`
  position: fixed;
  top: 0;  
  width: 100%;
  background-color: #d3d3d3;
  z-index: 2;
`;

const HeaderMenuTitleBox = styled.div`
    max-width: 960;
    padding: 1.5rem 3rem;
`;

const HeaderMenuTitle = styled(Link)`
  font-size: 2.2rem;
  font-weight: bold;
`;

const HeaderMenu = ( { siteTitle } ) => (
  <HeaderMenuStyle>
    <HeaderMenuTitleBox>
        <HeaderMenuTitle>
            { siteTitle }
        </HeaderMenuTitle>
    </HeaderMenuTitleBox>
  </HeaderMenuStyle>
)

export default HeaderMenu;
